import './index.css';

const BecomeOurPremPartner = () => {
    return (
        <div className='container-fluid become-partner' style={{backgroundImage: 'url(/image/page6_background.png'}}>
            <div className='row align-items-center become-partner-content container'>
                <h2 className='col-lg-7 col-md-12 text-white'>Become our Premium Partner now!</h2>
                <div className='col-lg-5 col-md-12 d-flex become-partner-btn-col'>
                    <button className='text-white text-uppercase become-partner-btn'>join now</button>
                </div>
            </div>
        </div>
    );
};

export default BecomeOurPremPartner;
